import React from 'react'
import "./StarRating.scss"
import StarIcon from '@mui/icons-material/StarRate';


export default function StarRating() {
  return (
    <div className='StarRating'>
        {[...Array(5)].map(star => {
            <StarIcon className='star' />
        })}
    </div>
  )
}
